【不動産決定物件登録との内容不一致】
決定物件登録で、不動産会社と社員の入力内容が一致しませんでした。
内容を確認してください。

＜仲介会社名＞
不動産会社登録：{!get_NewMatter.DecisionAgencyName__c}
社員登録：{!var_NewMatterRecord.DecisionAgencyNameForEmployee__c}
＜物件名＞
不動産会社登録：{!get_NewMatter.DecisionRealEstateName__c}
社員登録：{!var_NewMatterRecord.DecisionRealEstateNameForEmployee__c}
＜部屋番号＞
不動産会社登録：{!get_NewMatter.DecisionRealEstateRoom__c}
社員登録：{!var_NewMatterRecord.DecisionRealEstateRoomForEmployee__c}
＜契約開始日＞
不動産会社登録：{!get_NewMatter.DecisionContractStartDate__c}
社員登録：{!var_NewMatterRecord.DecisionContractStartDateForEmployee__c}

【不動産未特定】
不動産会社を自動で特定することができませんでした。
登録された不動産会社情報をご確認ください。
・不動産会社名：{!input_AgencyName}
・不動産電話番号：{!input_AgencyTellNum}
